 iPhone\",\"author_id\":\"1185239150468980737\",\"lang\":\"en\",\"created_at\":\"2021-06-03T13:04:55.000Z\",\"possibly_sensitive\":false,\"conversation_id\":\"1400438347768774659\",\"text\":\"Today is my birthday. After the worst two months I’ve ever been through I’m going to draw a line and move on. Baby steps. But time to put myself back together.\"},{\"id\":\"1400518619000365062\",\"public_metrics\":{\"retweet_count\":0,\"reply_count\":3,\"like_count\":96,\"quote_count\":0},\"source\":\"Twitter for iPhone\",\"author_id\":\"43203966\",\"lang\":\"en\",\"created_at\":\"2021-06-03T18:23:53.000Z\",\"possibly_sensitive\":false,\"conversation_id\":\"1400518619000365062\",\"text\":\"Having one of those Pride evenings where I remember how proud I am of being queer and trans and happy \\uD83E\\uDD70\\uD83C\\uDFF3️‍\\uD83C\\uDF08\\uD83C\\uDFF3️‍⚧️\\uD83E\\uDD70\\uD83C\\uDFF3️‍\\uD83C\\uDF08\\uD83E\\uDD70\\uD83C\\uDFF3️‍⚧️\\uD83D\\uDE0B\\uD83E\\uDD70\\uD83C\\uDFF3️‍⚧️\\uD83D\\uDE0B\\uD83E\\uDD70 and oh my is that a whole bottle of white I’ve finished.\"},{\"id\":\"1400473989634478087\",\"attachments\":{\"media_keys\":[\"3_1400473980436418563\"]},\"public_metrics\":{\"retweet_count\":1,\"reply_count\":1,\"like_count\":14,\"quote_count\":0},\"source\":\"Twitter for iPhone\",\"author_id\":\"135522881\",\"lang\":\"en\",\"entities\":{\"urls\":[{\"start\":29,\"end\":52,\"url\":\"https://t.co/LKeU1yVjgi\",\"expanded_url\":\"https://twitter.com/anwenhooson/status/1400473989634478087/photo/1\",\"display_url\":\"pic.twitter.com/LKeU1yVjgi\"}]},\"created_at\":\"2021-06-03T15:26:33.000Z\",\"possibly_sensitive\":false,\"conversation_id\":\"1400473989634478087\",\"text\":\"Happy author, happy agent. \\uD83C\\uDF08 https://t.co/LKeU1yVjgi\"},{\"id\":\"1400426613548929035\",\"attachments\":{\"media_keys\":[\"3_1400426218512687107\"]},\"public_metrics\":{\"retweet_count\":17,\"reply_count\":1,\"like_count\":66,\"quote_count\":3},\"source\":\"Twitter Web App\",\"author_id\":\"156265400\",\"lang\":\"en\",\"entities\":{\"urls\":[{\"start\":262,\"end\":285,\"url\":\"https://t.co/DGPJSwGycO\",\"expanded_url\":\"https://bit.ly/3g4ThSn\",\"display_url\":\"bit.ly/3g4ThSn\",\"images\":[{\"url\":\"https://pbs.twimg.com/news_img/1407408671819239426/YW4Fz4u9?format=jpg&name=orig\",\"width\":309,\"height\":500},{\"url\":\"https://pbs.twimg.com/news_img/1407408671819239426/YW4Fz4u9?format=jpg&name=150x150\",\"width\":150,\"height\":150}],\"status\":200,\"title\":\"We Can Do Better Than This ed. by Amelia Abraham | Gay's The Word\",\"description\":\"How can we create a better world for LGBTQ+ people? 35 extraordinary voices share their stories and visions for the future. Gay's the Word are hosting a digital book event to celebrate publication of We Can Do Better Than this on Tuesday June 22nd, with Amelia Abraham, Shon Faye, Yasmin Benoit, Adam Eli and more. Info hereWe talk about achieving 'LGBTQ+ equality', but around the world, LGBTQ+ people are still suffering discrimination and extreme violence. How do we solve this urgent problem, allowing queer people everywhere the opportunity to thrive?In We Can Do Better Than This, 35 voices explore this question. Through deeply moving stories and provocative new arguments on safety and visibility, dating and gender, care and community, they map new global frontiers in the fight for LGBTQ+ rights.Pabllo Vittar pleads for the end of hate murders, Olly Alexander champions inclusive sex education in schools, and Beth Ditto calls for a revolution in representation. Elsewhere, Mykki Blanco se\",\"unwound_url\":\"https://www.gaystheword.co.uk/product-page/we-can-do-better-than-this-ed-by-amelia-abraham\"},{\"start\":286,\"end\":309,\"url\":\"https://t.co/wuqMqq4VWf\",\"expanded_url\":\"https://twitter.com/gaystheword/status/1400426613548929035/photo/1\",\"display_url\":\"pic.twitter.com/wuqMqq4VWf\"}],\"mentions\":[{\"start\":17,\"end\":30,\"username\":\"MillyAbraham\",\"id\":\"604665555\"},{\"start\":130,\"end\":143,\"username\"